ion\";s:3:\"url\";s:82:\"https://microsoftedge.microsoft.com/addons/detail/oaaecoiolcpocebdnakfpfjegbmmpkjn\";s:10:\"repository\";s:43:\"https://github.com/tosdr/browser-extensions\";}i:4;O:8:\"stdClass\":6:{s:7:\"browser\";s:5:\"Opera\";s:4:\"type\";s:6:\"add-on\";s:5:\"image\";s:52:\"/themes/crisp/img/browser-extensions/icons/opera.svg\";s:11:\"description\";s:17:\"opera_description\";s:3:\"url\";s:72:\"https://addons.opera.com/extensions/details/terms-of-service-didnt-read/\";s:10:\"repository\";s:36:\"https://github.com/tosdr/tosdr-opera\";}}','2020-12-02 09:09:20','serialized','2020-12-02 09:09:20'),('plugin_core_members','a:12:{i:0;O:8:\"stdClass\":7:{s:4:\"name\";s:15:\"Michiel de Jong\";s:3:\"sub\";s:14:\"Code Communist\";s:5:\"image\";s:29:\"/plugins/core/img/michiel.png\";s:7:\"twitter\";s:14:\"michielbdejong\";s:11:\"description\";s:353:\"Michiel de Jong is an independent freedom hacker, travelling the world while programming for the revolution from his laptop. Apart from ToS;DR he is also involved in <a href=\"http://2012.unhosted.org\">The Unhosted Unconference</a> and he is a co-author of <a href=\"http://www.w3.org/community/unhosted/wiki/RemoteStorage\">the remoteStorage protocol</a>.\";s:3:\"url\";s:26:\"http://michielbdejong.com/\";s:6:\"github\";s:14:\"michielbdejong\";}i:1;O:8:\"stdClass\":7:{s:4:\"name\";s:23:\"Jan-Christoph Borchardt\";s:3:\"sub\";s:15:\"Design Dictator\";s:5:\"image\";s:25:\"/plugins/core/img/jan.jpg\";s:7:\"twitter\";s:13:\"jancborchardt\";s:11:\"description\";s:368:\"Jan-Christoph Borchardt is a free culture interaction designer, advisor &amp; educator. He curates <a href=\"http://libreprojects.net\">open source web projects</a>, designs <a href=\"http://unhosted.org\">unhosted web apps</a> &amp; <a href=\"http://ownCloud.org\">ownCloud</a> and <a href=\"http://jancborchardt.net/usability-in-free-software\">teaches better usability</a>.\";s:3:\"url\";s:25:\"http://jancborchardt.net/\";s:6:\"github\";s:13:\"jancborchardt\";}i:2;O:8:\"stdClass\":7:{s:4:\"name\";s:8:\"Hugo Roy\";s:3:\"sub\";s:15:\"Legal Liberator\";s:5:\"image\";s:26:\"/plugins/core/img/hugo.jpg\";s:7:\"twitter\";s:8:\"hugoroyd\";s:11:\"description\";s:239:\"Hugo is an <a href=\"https://attorney.hroy.eu\">attorney</a> at the Paris bar, and a volunteer at the <a href=\"http://fsfe.org\">Free Software Foundation Europe</a>. He currently lives in Paris, where he is often referred to as a Zappa Freak.\";s:3:\"url\";s:31:\"http://hugoroy.eu/index.en.html\";s:6:\"github\";s:0:\"\";}i:3;O:8:\"stdClass\":6:{s:4:\"name\";s:11:\"Ian McGowan\";s:3:\"sub\";s:0:\"\";s:5:\"image\";s:25:\"/plugins/core/img/ian.jpg\";s:7:\"twitter\";s:0:\"\";s:11:\"description\";s:309:\"Ian received his MA in Forensic Linguistics, the study of language within a legal context, from Cardiff University, investigating consumer motivation behind reading, or not reading, online Terms & Conditions. He is currently living and teaching English in Seville, Spain in addition to contributing to ToS;DR.\";s:3:\"url\";s:0:\"\";}i:4;O:8:\"stdClass\":7:{s:4:\"name\";s:10:\"Jimm Stout\";s:3:\"sub\";s:0:\"\";s:5:\"image\";s:26:\"/plugins/core/img/jimm.jpg\";s:7:\"twitter\";s:9:\"jimmstout\";s:11:\"description\";s:243:\"Jimm is traveling and working from \"offices\" around the world. Most of his time is going to developing a new version of ToSBack, but he also likes to act like a <a href=\"https://plus.google.com/u/0/116145020812303381665/posts\">photographer</a>\";s:3:\"url\";s:21:\"http://jimmstout.com/\";s:6:\"github\";s:9:\"jimmstout\";}i:5;O:8:\"stdClass\":6:{s:4:\"name\";s:16:\"Suzanne Azmayesh\";s:3:\"sub\";s:18:\"Analysis Anarchist\";s:5:\"image\";s:29:\"/plugins/core/img/suzanne.jpg\";s:7:\"twitter\";s:0:\"\";s:11:\"description\";s:131:\"Suzanne does not know what she wants to do with her life, so until then she reads terms of service. (Oh, and she has a law degree.)\";s:3:\"url\";s:0:\"\";}i:6;O:8:\"stdClass\":7:{s:4:\"name\";s:17:\"Christopher Talib\";s:3:\"sub\";s:0:\"\";s:5:\"image\";s:27:\"/plugins/core/img/chris.jpg\";s:7:\"twitter\";s:11:\"christalib_\";s:11:\"description\";s:39:\"Working for a better Internet everyday.\";s:3:\"url\";s:0:\"\";s:6:\"github\";s:10:\"christalib\";}i:7;O:8:\"stdClass\":7:{s:4:\"name\";s:13:\"Vincent Tunru\";s:3:\"sub\";s:9:\"Developer\";s:5:\"image\";s:29:\"/plugins/core/img/vincent.png\";s:7:\"twitter\";s:12:\"VincentTunru\";s:11:\"description\";s:158:\"Vincent is a front-end engineer from the Netherlands focused on civil rights. If he has the time and energy, he occasionally does some coding work for ToS;DR.\";s:3:\"url\";s:0:\"\";s:6:\"github\";s:0:\"\";}i:8;O:8:\"stdClass\":7:{s:4:\"name\";s:16:\"Madeline O\'Leary\";s:3:\"sub\";s:9:\"Developer\";s:5:\"image\";s:30:\"/plugins/core/img/madeline.png\";s:7:\"twitter\";s:11:\"madeline_oh\";s:11:\"description\";s:203:\"When not developing the Edit Tool for ToS;DR, Madeline O\'Leary is a software developer for the International Consortium of Investigative Journalists. She also spends considerable time making weird music.\";s:3:\"url\";s:0:\"\";s:6:\"github\";s:9:\"madoleary\";}i:9;O:8:\"stdClass\":6:{s:4:\"name\";s:11:\"Evan Mullen\";s:3:\"sub\";s:22:\"Privacy Philanthropist\";s:5:\"image\";s:26:\"/plugins/core/img/evan.jpg\";s:7:\"twitter\";s:0:\"\";s:11:\"description\";s:177:\"Evan is dedicated to making the world a better place by giving consumers more information about what they agree to in the fine print. He currently resides in San Antonio, Texas.\";s:3:\"url\";s:0:\"\";}i:10;O:8:\"stdClass\":7:{s:4:\"name\";s:28:\"Guennadi Maximov Cort&#xE9;s\";s:3:\"sub\";s:11:\"Self Taught\";s:5:\"image\";s:30:\"/plugins/core/img/guennadi.jpg\";s:7:\"twitter\";s:13:\"jeffsamonarch\";s:11:\"description\";s:261:\"19 year-old Guennadi (AKA \"Dr.Jeff\") has yet a lot to learn, but is determined to help in any way he can. He currently resides in Mexico, and is barely starting his career on Philosophy, expecting to someday focus his research on Privacy. Also learning to code.\";s:3:\"url\";s:0:\"\";s:6:\"github\";s:9:\"DrKJeff16\";}i:11;O:8:\"stdClass\":7:{s:4:\"name\";s:21:\"Justin Ren&#xE9; Back\";s:3:\"sub\";s:18:\"Software Developer\";s:5:\"image\";s:28:\"/plugins/core/img/justin.jpg\";s:7:\"twitter\";s:14:\"justinreneback\";s:11:\"description\";s:75:\"Software Developer and CEO of a privacy focused company. He also has a cat!\";s:3:\"url\";s:22:\"https://justinback.com\";s:6:\"github\";s:10:\"justinback\";}}','2020-12-02 09:09:21','serialized','2020-12-02 09:09:21'),('plugin_dir','plugins','2020-06-25 15:45:13','string','2020-10-29 12:52:40'),('plugin_helloworld_display_hello_world','1','2020-12-01 05:11:00','boolean','2020-12-01 05:11:00'),('site_logo','/themes/logo.png','2020-10-02 13:06:56','string','2020-10-29 12:52:40'),('site_name','ToS;DR - Terms of Service; Didn\'t Read','2020-10-31 17:18:01','string','2020-10-29 12:52:40'),('theme','crisp','2020-06-25 15:45:20','string','2020-10-29 12:52:40'),('theme_dir','themes','0000-00-00 00:00:00','string','2020-10-31 16:46:13');

