/*Table structure for table `Languages` */

DROP TABLE IF EXISTS `Languages`;

CREATE TABLE `Languages` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `Name` varchar(255) NOT NULL,
  `Code` varchar(255) NOT NULL,
  `NativeName` varchar(255) NOT NULL,
  `Flag` varchar(255) NOT NULL,
  `Enabled` tinyint(1) NOT NULL DEFAULT 0,
  KEY `ID` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8mb4;

/*Data for the table `Languages` */

insert  into `Languages`(`ID`,`Name`,`Code`,`NativeName`,`Flag`,`Enabled`) values (1,'English','en','English','svg/united-states-of-america.svg',1),(2,'German','de','Deutsch','svg/germany.svg',1),(20,'es','es','es','es',1);

/*Table structure for table `Translations` */

DROP TABLE IF EXISTS `Translations`;

CREATE TABLE `Translations` (
  `key` varchar(255) NOT NULL,
  `en` text DEFAULT NULL,
  `de` text DEFAULT NULL,
  `es` text DEFAULT NULL,
  PRIMARY KEY (`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `Translations` */

insert  into `Translations`(`key`,`en`,`de`,`es`) values ('add_to','Add to {{ browser }}',NULL,'Agregar a {{ browser }}'),('api','API','API','API'),('downloads','Downloads','Downloads','Descargar'),('downloads_jumbotron_paragraph_1','Install the browser extensions to get instant information about the terms and privacy policies of websites you browse! ','Installiere unsere Erweiterung in deinem Browser und bekomme direkt Informationen zu Datenschutzerklärungen auf den Seiten, auf denen du unterwegs bist! ','¡Instala nuestras extensiones de navegador para mantenerte informado acerca de los Términos y Condiciones de los Sitios Web que visitas a diario! '),('error_page_not_found','Page not found','Seite nicht gefunden',NULL),('error_page_not_found_description','This page does not exist on ToS;DR, are you sure you entered it correctly?',NULL,NULL),('error_service_not_found','No matching services',NULL,NULL),('error_service_not_found_description','No matching service has been found. You can add a service on our forum.<br><a href=\"https://forum.tosdr.org/request\">https://forum.tosdr.org/request</a>',NULL,NULL),('frontpage','Frontpage','Startseite','Inicio'),('frontpage_forum_button_forum','Pay our forum a visit!','Besuche unser forum!','¡Checa nuestro foro!'),('frontpage_intro_bottom_text','Terms of service are often <strong>too long to read</strong>, but it\'s important to understand what\'s in them. Your rights online depend on them. <!--Get informed about your rights: install the browser extension for <a href=\"https://addons.mozilla.org/en-US/firefox/addon/terms-of-service-didnt-read/\">Firefox</a>, <a href=\"https://chrome.google.com/webstore/detail/hjdoplcnndgiblooccencgcggcoihigg\">Chrome</a>, <a href=\"https://addons.opera.com/extensions/details/terms-of-service-didnt-read/\">Opera</a> or <a href=\"https://safariextension.tosdr.org/\">Safari</a>.</p-->We hope that our ratings can help you get informed about your rights. Do not hesitate to click <a href=\"#services\">on a service below</a>, to have more details! You can also get the ratings directly in your browser by installing our web browser add-on:','Terms of service are often <strong>too long to read</strong>, but it\'s important to understand what\'s in them. Your rights online depend on them. We hope that our ratings can help you get informed about your rights. Do not hesitate to click <a href=\"#services\">on a service below</a>, to have more details! You can also get the ratings directly in your browser by installing our web browser add-on:','Los Términos y Condiciones que acostumbramos ver suelen ser <strong>demasiado largos</strong>, pero no por ello dejan de ser importantes, ¡pues tus Derechos digitales dependen de ellos! <!--Get informed about your rights: install the browser extension for <a href=\"https://addons.mozilla.org/en-US/firefox/addon/terms-of-service-didnt-read/\">Firefox</a>, <a href=\"https://chrome.google.com/webstore/detail/hjdoplcnndgiblooccencgcggcoihigg\">Chrome</a>, <a href=\"https://addons.opera.com/extensions/details/terms-of-service-didnt-read/\">Opera</a> or <a href=\"https://safariextension.tosdr.org/\">Safari</a>.</p-->Queremos que nuestras reseñas te informen acerca de tus derechos. Te invitamos a checar <a href=\"#services\">alguno de los Servicios debajo</a>, para obtener más información. También puedes ver nuestras reseñas descargando alguna de nuestras extensiones:'),('frontpage_intro_button_contribute','Contribute On Phoenix!','Trage zu dem Projekt auf Phoenix bei!','¡Contribuye en Phoenix!'),('frontpage_intro_button_download','Download Browser Addon','Downloade unsere Browser-Erweiterung','Descargar Extensión'),('frontpage_intro_top_text','We are a user rights <a href=\"/about\" title=\"Learn more about us\">initiative</a> to <a href=\"/classification\" title=\"What\'s our classification?\">rate and label</a> website terms &amp; privacy policies, from very good <span class=\"label A\">Class A</span> to&nbsp;very&nbsp;bad&nbsp;<span class=\"label E\">Class E</span>.','We are a user rights <a href=\"/about\" title=\"Learn more about us\">initiative</a> to <a href=\"/classification\" title=\"What\'s our classification?\">rate and label</a> website terms &amp; privacy policies, from very good <span class=\"label A\">Class A</span> to&nbsp;very&nbsp;bad&nbsp;<span class=\"label E\">Class E</span>.','Somos una <a href=\"/about\" title=\"Más sobre nosotros.\">iniciativa</a> encaminada a los Derechos del Consumidor, que <a href=\"/classification\" title=\"¿Cómo calificamos?\">califica y clasifica</a> Términos de Servicio y Políticas de Privacidad, entre otros documentos, partiendo de <strong>Excelente</strong> <span class=\"label A\">Clase A</span> a <strong>Muy Malo</strong> <span class=\"label E\">Clase E</span>.'),('frontpage_jumbotron_text','“I have read and agree to the Terms” is the biggest lie on the web. We aim to fix that.','“I have read and agree to the Terms” is the biggest lie on the web. We aim to fix that.','“He leído y acepto los Términos” es la mentira más grande de la Red. Nosotros lo arreglamos.'),('frontpage_ratings_ratingssearch_placeholder','Search for a service here...','Suche nach einem Dienst hier..','Busca un Servicio aquí...'),('help_expanding','Help expanding this list by contributing on Phoenix!','Help expanding this list by contributing on Phoenix!','¡Apóyanos contribuyendo en Phoenix!'),('navbar_item_about','About Us','Über uns','Sobre Nosotros'),('navbar_item_download','Download Extensions','Erweiterungen herunterladen','Descargas'),('navbar_item_forum','Forum','Forum','Foro'),('navbar_item_home','Home','Startseite','Inicio'),('navbar_item_ratings','Ratings','Bewertungen','Calificaciones'),('plugin_core_about','About',NULL,NULL),('plugin_core_about_jumbotron_paragraph_1','“Terms of Service; Didn\'t Read” (short: ToS;DR) is a young project started in June 2012 to help fix the “biggest lie on the web”: almost no one really reads the terms of service we agree to all the time.',NULL,NULL),('plugin_core_about_jumbotron_paragraph_2','<strong>Background.</strong> The rough idea behind ToS;DR emerged during the <a href=\"http://events.ccc.de/camp/2011/wiki/ToS;DR\">2011 Chaos Communication Camp</a> near Berlin, with people from <a href=\"http://unhosted.org\">Unhosted</a> a movement to create web apps that give users control over their valuable user data and privacy. In the summer of 2012, <a href=\"http://hugoroy.eu/index.en.html\">Hugo Roy</a> (<a href=\"http://twitter.com/hugoroyd\">@hugoroyd</a>) started the legal analysis and brought the project to life. Since then, more people have joined the team and have contributed through the reviewer community. Ultimately, all the work is transparent and the discussions happen in public. Our work is <a href=\"thanks\">funded</a> by non-profits organisations and individual donations and gets released as <a href=\"http://fsfe.org/about/basics/freesoftware.html\">free software</a> and open data.',NULL,NULL),('plugin_core_about_jumbotron_paragraph_3','Please bear in mind that the project is still in the early phase and that most data is subject to important changes. More information about <a href=\"classification\">our classification</a>.',NULL,NULL),('plugin_core_about_jumbotron_paragraph_4','<strong>What does “ToS;DR” mean?</strong> the name is inspired by internet acronym TL;DR which stands for \"Too Long; Didn\'t Read\" and is often used on blogs and emails when a block of text is just really long and that people are too lazy to read the whole stuff. It was intended more as a code name than as a real name. But it seems that people like it (do you?)',NULL,NULL),('plugin_core_add-on','add-on','Addon',NULL),('plugin_core_add_to','Add to {{ browser }}','Zu {{ browser }} hinzufügen',NULL),('plugin_core_chrome_description','This extension will add a small icon in the right side of your address bar. If you are browsing a website that is not in our database, nothing will appear. Click on the icon to 